import React from 'react'
//import {Typography} from '@material-ui/core';
//import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField'
import Grid from '@material-ui/core/Grid';
import Box from "@material-ui/core/Box";

export default function RegisterMember(props){

    return(
        <div>
        
        <Grid container   direction="column" spacing={33}  justify="center"   alignItems="center">

            <Grid container direction="row" justify="center"   alignItems="center">
                <TextField  label="First Name" variant="outlined"/>
                <TextField  label="Last Name" variant="outlined"/> 
            </Grid>
        
        
            <TextField label="Address" multiline rows={4} defaultValue=""/>
        

            <TextField  label="Date of Birth" type="date" defaultValue="2017-05-24"/>
                    
        </Grid>
        
        </div>  
    )

};
